import React from 'react';
import '../assets/css/style.css'; // Assuming your CSS file is named style.css
import backgroundImg from '../assets/img/bg1.jpg'; // Assuming the background image path

function WelcomePage() {
  return (
    <div className="container body" style={{ backgroundImage: `url(${backgroundImg})`, }}>
      <h2 className="welcome-title">Welcome</h2>
      <div className="buttons">
        <button className="login-btn">Wanna Login Here?</button>
        <button className="signup-btn">Don't have an account?</button>
      </div>
      <div className="login-signup-buttons">
        <button className="login-button">Login Button</button>
        <button className="signup-button">Signup Button</button>
      </div>
    </div>
  );
}

export default WelcomePage;
